new Vue({
  el: "#app",
  data() {
    return {
      audio: null,
      circleLeft: null,
      barWidth: null,
      duration: null,
      currentTime: null,
      isTimerPlaying: false,
      tracks: [
        {
          name: "Golden Brown",
          artist: "The Strangers",
          cover: "data:image/jpeg;base64,",
          source: "https://open.spotify.com/track/5GpfyJrKHJI36jDKtQiyGN?si=52a21ba4e67d4c68",
          url: "https://www.youtube.com/watch?v=AWAsI3U2EaE&list=RDAWAsI3U2EaE&start_radio=1",
          favorited: false
        },
        {
          name: "Yours Eyes(English Version)",
          artist: "Baren Sky",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\yours eyes .mp4",
          url: "https://www.youtube.com/watch?v=Q8AnXArg6I4&list=RDQ8AnXArg6I4&start_radio=1",
          favorited: true
        },
        {
          name: "Perfect",
          artist: "ED Sheeran",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\Perfect.mpeg",
          url: "https://www.youtube.com/watch?v=2Vv-BfVoq4g&list=RD2Vv-BfVoq4g&start_radio=1",
          favorited: false
        },
        {
          name: "Until i found you",
          artist: "Stephen Sanchez",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\Until i found you.mpeg",
          url: "https://www.youtube.com/watch?v=GxldQ9eX2wo&list=RDGxldQ9eX2wo&start_radio=1&pp=ygURdW50aWwgaSBmb3VuZCB5b3WgBwE%3D",
          favorited: false
        },
        {
          name: "Co2",
          artist: "Prakeet Kuhad",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\Co2.mpeg",
          url: "https://www.youtube.com/watch?v=U2SVCCENLjE&list=RDU2SVCCENLjE&start_radio=1&pp=ygUDY28yoAcB",
          favorited: false
        },
        {
          name: "ჩუბინა",
          artist: "East Duo",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\ჩუბინა.mpeg",
          url: "https://www.youtube.com/watch?v=ZqeCjnEI4b0&list=RDZqeCjnEI4b0&start_radio=1&pp=ygUIZWFzdCBkdW-gBwE%3D",
          favorited: false
        },
        {
          name: "Ku Lo Sa(Ryuken Ishida)",
          artist: "Oxlade",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\kul lo sa.mp4",
          url: "https://www.youtube.com/shorts/5nKfJ4r7Dwg",
          favorited: false
        },
        {
          name: "Love Nwantiti",
          artist: "CKay",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\love nwaniti.mpeg",
          url: "https://www.youtube.com/watch?v=VYtSJFV46Tk&list=RDVYtSJFV46Tk&start_radio=1&pp=ygUNbG92ZSBud2FudGl0aaAHAQ%3D%3D",
          favorited: false
        },
        {
          name: "Samurai!!!",
          artist: "Deekay",
          cover: "data:image/jpeg;base64,",
          source: "C:\\Users\\wassan\\OneDrive\\เอกสาร\\Samurai!!!.mpeg",
          url: "https://www.youtube.com/watch?v=pOvlRKCi7oE&list=RDpOvlRKCi7oE&start_radio=1&pp=ygUOc2FtdXJhaSBkZWVrYXmgBwE%3D",
          favorited: false
        }
      ],
      currentTrack: null,
      currentTrackIndex: 0,
      transitionName: null
    };
  },
  methods: {
    play() {
      if (this.audio.paused) {
        this.audio.play();
        this.isTimerPlaying = true;
      } else {
        this.audio.pause();
        this.isTimerPlaying = false;
      }
    },
    generateTime() {
      let width = (100 / this.audio.duration) * this.audio.currentTime;
      this.barWidth = width + "%";
      this.circleLeft = width + "%";
      let durmin = Math.floor(this.audio.duration / 60);
      let dursec = Math.floor(this.audio.duration - durmin * 60);
      let curmin = Math.floor(this.audio.currentTime / 60);
      let cursec = Math.floor(this.audio.currentTime - curmin * 60);
      if (durmin < 10) {
        durmin = "0" + durmin;
      }
      if (dursec < 10) {
        dursec = "0" + dursec;
      }
      if (curmin < 10) {
        curmin = "0" + curmin;
      }
      if (cursec < 10) {
        cursec = "0" + cursec;
      }
      this.duration = durmin + ":" + dursec;
      this.currentTime = curmin + ":" + cursec;
    },
    updateBar(x) {
      let progress = this.$refs.progress;
      let maxduration = this.audio.duration;
      let position = x - progress.offsetLeft;
      let percentage = (100 * position) / progress.offsetWidth;
      if (percentage > 100) {
        percentage = 100;
      }
      if (percentage < 0) {
        percentage = 0;
      }
      this.barWidth = percentage + "%";
      this.circleLeft = percentage + "%";
      this.audio.currentTime = (maxduration * percentage) / 100;
      this.audio.play();
    },
    clickProgress(e) {
      this.isTimerPlaying = true;
      this.audio.pause();
      this.updateBar(e.pageX);
    },
    prevTrack() {
      this.transitionName = "scale-in";
      this.isShowCover = false;
      if (this.currentTrackIndex > 0) {
        this.currentTrackIndex--;
      } else {
        this.currentTrackIndex = this.tracks.length - 1;
      }
      this.currentTrack = this.tracks[this.currentTrackIndex];
      this.resetPlayer();
    },
    nextTrack() {
      this.transitionName = "scale-out";
      this.isShowCover = false;
      if (this.currentTrackIndex < this.tracks.length - 1) {
        this.currentTrackIndex++;
      } else {
        this.currentTrackIndex = 0;
      }
      this.currentTrack = this.tracks[this.currentTrackIndex];
      this.resetPlayer();
    },
    resetPlayer() {
      this.barWidth = 0;
      this.circleLeft = 0;
      this.audio.currentTime = 0;
      this.audio.src = this.currentTrack.source;
      setTimeout(() => {
        if (this.isTimerPlaying) {
          this.audio.play();
        } else {
          this.audio.pause();
        }
      }, 300);
    },
    favorite() {
      this.tracks[this.currentTrackIndex].favorited = !this.tracks[
        this.currentTrackIndex
      ].favorited;
    }
  },
  created() {
    let vm = this;
    this.currentTrack = this.tracks[0];
    this.audio = new Audio();
    this.audio.src = this.currentTrack.source;
    this.audio.ontimeupdate = function () {
      vm.generateTime();
    };
    this.audio.onloadedmetadata = function () {
      vm.generateTime();
    };
    this.audio.onended = function () {
      vm.nextTrack();
      this.isTimerPlaying = true;
    };

    // this is optional (for preload covers)
    for (let index = 0; index < this.tracks.length; index++) {
      const element = this.tracks[index];
      let link = document.createElement('link');
      link.rel = "prefetch";
      link.href = element.cover;
      link.as = "image"
      document.head.appendChild(link)
    }
  }

});
